css:
atom-text-editor,
atom-text-editor {
  background-color: #fff;
  color: #495057;
}
atom-text-editor .wrap-guide,
atom-text-editor .wrap-guide {
  background-color: transparent;
}
atom-text-editor .indent-guide,
atom-text-editor .indent-guide {
  color: #adb5bd;
}
atom-text-editor .invisible-character,
atom-text-editor .invisible-character {
  color: #adb5bd;
}
atom-text-editor .lines .cursor-line,
atom-text-editor .lines .cursor-line {
  background-color: #fff;
}
atom-text-editor .gutter,
atom-text-editor .gutter {
  background-color: #fff;
  color: #adb5bd;
}
atom-text-editor .gutter .line-number.cursor-line,
atom-text-editor .gutter .line-number.cursor-line {
  background-color: #fff;
  color: #212529;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  color: #212529;
}
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
atom-text-editor .gutter .line-number:after,
atom-text-editor .fold-marker:after,
atom-text-editor .fold-marker:after {
  color: #495057;
}
atom-text-editor .invisible,
atom-text-editor .invisible {
  color: #495057;
}
atom-text-editor .cursor,
atom-text-editor .cursor {
  color: #00BAFF;
  border-left: 2px solid;
}
atom-text-editor .selection .region,
atom-text-editor .selection .region {
  background-color: #f1f3f5;
}
atom-text-editor .search-results .syntax--marker .region,
atom-text-editor .search-results .syntax--marker .region {
  border: 1px solid #329af0;
}
atom-text-editor .search-results .syntax--marker.current-result .region,
atom-text-editor .search-results .syntax--marker.current-result .region {
  border: 1px solid #1862ab;
}
.syntax--string {
  color: #868e96;
}
.syntax--comment {
  color: #adb5bd;
  background-color: transparent;
}
.syntax--punctuation.syntax--definition.syntax--comment {
  color: #adb5bd;
}
.syntax--punctuation.syntax--definition.syntax--bold {
  color: #495057;
  font-weight: bold;
}
.syntax--punctuation.syntax--definition.syntax--italic {
  color: #495057;
  font-style: italic;
}
.syntax--punctuation.syntax--section.syntax--embedded {
  color: #495057;
}
.syntax--source.syntax--css .syntax--selector {
  color: #202123;
  font-weight: bold;
}
.syntax--source.syntax--css .syntax--property-value {
  color: #868e96;
}
.syntax--source.syntax--gfm .syntax--heading.syntax--marker {
  font-weight: normal;
}
.syntax--source.syntax--gfm .syntax--heading {
  color: #202123;
  font-weight: bold;
}
.syntax--todo,
.syntax--fixme,
.xxx {
  color: #202123;
  margin-right: 3px;
}
.bracket-matcher {
  border-bottom: none;
  position: absolute;
  background-color: rgba(0, 0, 0, 0);
}
atom-text-editor.editor .bracket-matcher .region {
  border-bottom: none;
  background-color: #e8f7ff;
  border-bottom: 1px solid #0097e8;
}
.tab-bar .syntax--tab[data-type="TextEditor"]::after {
  background-color: rgba(255, 255, 255, 0.15);
}
